typedef struct Pattern
{
    BYTE* bytes;
    BYTE* is_wild;
    SIZE_T length;
} Pattern;

int hexval(char c)
{
    if (c >= '0' && c <= '9') {
        return c - '0';
    }
    c = (char)tolower((unsigned char)c);
    if (c >= 'a' && c <= 'f') {
        return 10 + (c - 'a');
    }
    return -1;
}

int parse_pattern(const char* pattern_str, Pattern* out)
{
    memset(out, 0, sizeof(*out));

    SIZE_T n = strlen(pattern_str);
    BYTE* bytes = (BYTE*)malloc(n);
    BYTE* wild = (BYTE*)malloc(n);
    if (!bytes || !wild) {
        free(bytes);
        free(wild);
        return 0;
    }

    SIZE_T count = 0;
    const char* p = pattern_str;

    while (*p)
    {
        while (*p && isspace((unsigned char)*p)) {
            p++;
        }

        if (!*p) {
            break;
        }

        if (*p == '?')
        {
            p++;
            if (*p == '?') {
                p++;
            }
            bytes[count] = 0;
            wild[count] = 1;
            count++;
            continue;
        }

        int hi = hexval(*p++);
        while (*p && isspace((unsigned char)*p)) {
            p++;
        }
        int lo = hexval(*p++);

        if (hi < 0 || lo < 0)
        {
            free(bytes);
            free(wild);
            return 0;
        }

        bytes[count] = (BYTE)((hi << 4) | lo);
        wild[count] = 0;
        count++;
    }

    out->bytes = (BYTE*)realloc(bytes, count ? count : 1);
    out->is_wild = (BYTE*)realloc(wild, count ? count : 1);
    out->length = count;
    return (count > 0);
}

void free_pattern(Pattern* pat)
{
    free(pat->bytes);
    free(pat->is_wild);
    memset(pat, 0, sizeof(*pat));
}

int MemoryComparePattern(const BYTE* data, const Pattern* pat)
{
    for (SIZE_T i = 0; i < pat->length; i++)
    {
        if (pat->is_wild[i]) {
            continue;
        }

        if (data[i] != pat->bytes[i]) {
            return 0;
        }
    }
    return 1;
}

uintptr_t FindSignaturePattern(uintptr_t start, SIZE_T size, const Pattern* pat)
{
    BYTE* data = (BYTE*)malloc(size);
    SIZE_T bytesRead = 0;

    if (!data) {
        return 0;
    }

    if (!ReadProcessMemory(GetCurrentProcess(), (LPCVOID)start, data, size, &bytesRead) || bytesRead != size)
    {
        free(data);
        return 0;
    }

    if (pat->length == 0 || pat->length > size)
    {
        free(data);
        return 0;
    }

    for (SIZE_T i = 0; i <= size - pat->length; i++)
    {
        if (MemoryComparePattern(data + i, pat))
        {
            free(data);
            return start + i;
        }
    }

    free(data);
    return 0;
}

uintptr_t ScanPatternText(const char* moduleName, const char* patternText)
{
    HMODULE hModule = NULL;

    if (!moduleName || moduleName[0] == '\0') {
        hModule = GetModuleHandleA(NULL);
    }
    else {
        hModule = GetModuleHandleA(moduleName);
    }

    if (!hModule) {
        return 0;
    }

    MODULEINFO modInfo;
    if (!GetModuleInformation(GetCurrentProcess(), hModule, &modInfo, sizeof(modInfo))) {
        return 0;
    }

    Pattern pat;
    if (!parse_pattern(patternText, &pat)) {
        return 0;
    }

    uintptr_t baseAddress = (uintptr_t)modInfo.lpBaseOfDll;
    SIZE_T moduleSize = (SIZE_T)modInfo.SizeOfImage;

    uintptr_t result = FindSignaturePattern(baseAddress, moduleSize, &pat);
    free_pattern(&pat);
    return result;
}

static void* GetProcAddressAOB(const char* moduleName, const char* funcName)
{
    if (!moduleName || !funcName) {
        return NULL;
    }

    for (size_t i = 0; aob_table[i].name != NULL; ++i) {
        if (strcmp(aob_table[i].name, funcName) == 0) {
            for (size_t j = 0; j < aob_table[i].count; ++j) {
                const char* pat = aob_table[i].aob[j];
                if (!pat || pat[0] == '\0' || strcmp(pat, "NULL") == 0) {
                    continue;
                }

                void* addr = (void*)ScanPatternText(moduleName, pat);
                if (addr) {
                    return addr;
                }
            }
            return NULL;
        }
    }
    return NULL;
}

int main()
{
    for (size_t i = 0; aob_table[i].name != NULL; ++i) {
        const char* name = aob_table[i].name;

        void* addr = GetProcAddressAOB("ntdll.dll", name);
        if (addr) {
#if defined(_WIN64)
            printf("%s -> 0x%llX\n", name, (unsigned long long)(uintptr_t)addr);
#elif defined(_M_ARM64)
            printf("%s -> 0x%lX\n", name, (unsigned long)(uintptr_t)addr);
#endif
        }
        else {
            printf("[ERROR] %s -> NOT FOUND\n", name);
        }
    }

    system("pause");
}